import React from 'react';
import { ListGroup } from 'react-bootstrap';
import Topping from './DragSource';

const toppingData = [
    { url: "../../images/mushroom.png", id: "mushroom" },
    { url: "../../images/pepperoni.png", id: "pepperoni" },
    { url: "../../images/green_pepper.png", id: "green_pepper" },    
    { url: "../../images/black_olive.png", id: "black_olive" },    
]    


export default () => {
    return(
        <ListGroup style={{display: 'inline-block'}}>
            {toppingData.map((toppingData) => (
                <Topping key={toppingData.id} url={toppingData.url} />
            ))}
        </ListGroup>
    )
    
}
